import React from 'react'

export default function Loginc() {
  return (
    <div className='container'>
        <div className='row'>
      <h1>Who Are You</h1>
      <div className='col-xl-4'>Admin</div>
      <div className='col-xl-4'>Employee</div>
      <div className='col-xl-4'>Customer</div>
      </div>
    </div>
  )
}
